(1, 'Tiga manula jalan-jalan ke Selatan Jawa`', '741.5', 15, '741.5 RAC t', 14, 4, '9789799106308', '', '', '2013', '', '', NULL, 'Jakarta', '', '', '', 96, '17 cm', 1, 3, 'Pantang menyerah mencari Tingal, desa kelahiran Waluyo, Tiga Manula kini menyusuri Selatan Jawa. Tiga makam presiden diziarahi, Solo-Yogya dinikmati, Candi Borobudur didaki, Nusakambangan dijelajahi, dan beragam kuliner dicicipi. Dimanakah sebenarnya'),
(2, 'Sally Ann thunder Ann whirlwind crockett`', '813', 16, '813 KEL s', 19, 9, '0590969994', '', '', '1995', '', '', NULL, 'New York', '', '', '', 48, '28 cm', 2, 3, 'Sally ann thunder ann is the strongest, fastes woman around. But is she strong enough to rescue Davy Crockett and beat the mighty Mike Fink.'),
(3, 'Crime and Punishment`', '813', 16, '813 DOS c', 12, 5, '9781840224306', '', '', '2000', '', '', NULL, 'London', '', '', '', 486, '20 cm', 2, 3, 'This book is one of the greatest and most readable novels ever written. From the beginning we are locked into the frenzied consciousness of Raskolnikov who, againts his better instinest, is inexorably draw to commit a brutal double murder.'),
