(335, 'Rory''s story`', 'FIC', 11, 'FIC FIV r', 257, 81, '9781743003268', '', '', '2012', '', '', NULL, 'Victoria', '', '', '', 26, '24 Cm', 2, 3, 'Rory the tiger is having a terrible time. He has a new baby sister.\nShe''s too small to play with, she cries a lot, and everyone seems to have forgotten a bout him.'),
(336, 'Geoffrey and the giant`', 'FIC', 11, 'FIC THO g', 258, 50, '9781849560955', '', '', '2010', '', '', NULL, 'China', '', '', '', 1, '20,5 Cm', 2, 1, 'Children we love to follow brave knight, Geoffrey, as he hunts for a noisy giant then unfoldthe bookto reveal hidden giant.'),
(337, 'David and goliath`', '222', 169, '222 PAG d', 259, 82, '1846101735', '', '', '2006', '', '', NULL, 'China', '', '', '', 31, '15 Cm', 2, 1, 'Long time ago things were bad for israel..\nAt war with the Philistines and not doing well.'),
(338, 'Sari suka bersolek`', '823', 12, '823 ADI s', 260, 83, '9794300446', '', 'Dicky Sutadi', '2001', '', '', NULL, 'Jakarta', '', '', '', 18, '25 Cm', 4, 3, 'Sari seekor bangau yang cantik. Supaya tidak ketinggalan zaman, ia meniru dandanan teman-temannya.Apakah ia kelihatan cantik..'),
(339, 'Night,night,baby`', '811', 154, '811 MER n', 261, 84, '', '', '', '0', '', '', NULL, '', '', '', '', 8, '21 Cm', 2, 1, 'Flip the flap and see who''s there, behind the bunny or panda bear.'),
(340, 'Lettice`', 'FIC', 11, 'FIC STA l', 120, 85, '9780007847624', '', '', '2011', '', '', NULL, 'London', '', '', '', 26, '22,5 Cm', 2, 3, 'Lettice rabbit longs to fly but even when she flaps her arms and ears she can''t seem to lift off the ground.'),
